'''
给定一个由整数数组 A 表示的环形数组 C，求 C 的非空子数组的最大可能和。

在此处，环形数组意味着数组的末端将会与开头相连呈环状。（形式上，当0 <= i < A.length 时 C[i] = A[i]，且当 i >= 0 时 C[i+A.length] = C[i]）

此外，子数组最多只能包含固定缓冲区 A 中的每个元素一次。（形式上，对于子数组 C[i], C[i+1], ..., C[j]，不存在 i <= k1, k2 <= j 其中 k1 % A.length = k2 % A.length）

示例 1：
输入：[1,-2,3,-2]
输出：3
解释：从子数组 [3] 得到最大和 3

示例 2：
输入：[5,-3,5]
输出：10
解释：从子数组 [5,5] 得到最大和 5 + 5 = 10

示例 3：
输入：[3,-1,2,-1]
输出：4
解释：从子数组 [2,-1,3] 得到最大和 2 + (-1) + 3 = 4

示例 4：
输入：[3,-2,2,-3]
输出：3
解释：从子数组 [3] 和 [3,-2,2] 都可以得到最大和 3

示例 5：
输入：[-2,-3,-1]
输出：-1
解释：从子数组 [-1] 得到最大和 -1

提示：
-30000 <= A[i] <= 30000
1 <= A.length <= 30000
'''
import collections
from typing import List

from leetcode.tools.time import printTime


class Solution:
    @printTime()
    def maxSubarraySumCircular(self, nums: List[int]) -> int:
        l1 = len(nums)
        nums = nums + nums
        ret = nums[0]
        dp = []
        for i in range(l1):
            dp.clear()
            dp.append(nums[i])
            for j in range(i + 1, i + l1):
                if dp[j - i - 1] > 0:
                    dp.append(dp[j - i - 1] + nums[j])
                else:
                    dp.append(nums[j])
                if dp[j - i] > ret:
                    ret = dp[j - i]
        return ret

    @printTime()
    def _1maxSubarraySumCircular(self, nums: List[int]) -> int:
        l = len(nums)
        ret = nums[0]
        temp = [0]
        for i in range(2):
            for num in nums:
                temp.append(temp[-1] + num)
        queue = [0]
        left = 0
        right = 1
        for i in range(1, len(temp)):
            if queue[left] < i - l and left < right:
                left += 1
            ret = max(ret, temp[i] - temp[queue[left]])
            while queue and temp[i] <= temp[queue[right - 1]] and right > left:
                right -= 1
            queue = queue[:right]
            queue.append(i)
            right += 1
        return ret

